import React from 'react'
import ContactItem from '../Components/ContactItem';
import phone from '../img/phone.svg';
import email from '../img/emailme.svg';
import location from '../img/location.svg';
import Tittle from '../Components/Tittle';

function ContactPage() {
    return (
        <div>
            <div className="title">
                <Tittle title={'Contact Me'} span={'Contact Me'} />
            </div>
            <div className="ContactPage">
                <div className="map-sect">
                    <iframe src="https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d1119111.1231046573!2d71.51004897155562!3d22.876381676761127!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sin!4v1626100390730!5m2!1sen!2sin" width="600" height="450" frameBorder="0" style={{border:0}} allowFullScreen="" aria-hidden="false" tabIndex="0"></iframe>
                </div>
                <div className="contact-sect">
                    <ContactItem icon={phone} text1={'+91 9081106815'} text2={'+91 9426045907'} title={'Phone'}/>
                    <ContactItem icon={email} text1={'vruditdpatel1809@gmail.com'} text2={'buntydpatel1809@gmail.com'} title={'Email'}/>
                    <ContactItem icon={location} text1={'C/101 Kalarav, New Shahibaug, Ahmedabad,'} text2={'GJ, India'} title={'Address'}/>
                </div>
            </div>
        </div>
    )
}

export default ContactPage;
